(3, 1, 2, 'Politicas de Privacidad', 'Nuestros términos y condiciones', 'condiciones, términos, uso, venta', '<div class="cntArticleFlexibleHeader">\r\n<h2>Politicas de Privacidad</h2>\r\n</div>\r\n<div class="cntHubContent">\r\n<div class="wraptxt">\r\n<p>¿Qué información se recopila?</p>\r\n<p>Nosotros recopilamos información de usted cuando se registra en nuestro sitio, se suscribir a nuestro boletín de noticias, responde a una encuesta o llena un formulario.<br />Al ordenar o registrarse en nuestro sitio, se le puede pedir que introduzca su nombre o dirección de correo electrónico. Usted puede, sin embargo, visitar nuestro sitio de forma anónima.<br /><br /><strong>¿Para qué utilizamos su información?</strong></p>\r\n<p>Toda la información que obtenemos de usted puede ser usado en una de las siguientes maneras:<br />; Para personalizar su experiencia<br />(Su información nos ayuda a responder mejor a sus necesidades individuales)<br />, Para mejorar nuestro sitio web<br />(Nos esforzamos continuamente para mejorar nuestra oferta de sitio web basado en la información y la retroalimentación que recibimos de usted)<br />; Para mejorar el servicio al cliente<br />(Su información nos ayuda a responder más eficazmente a sus solicitudes de servicio al cliente y las necesidades de apoyo)<br />; Para procesar las transacciones<br />Su información, ya sea pública o privada, no será vendida, intercambiada, transferido o dado a ninguna otra empresa por cualquier motivo, sin su consentimiento, excepto con el expreso propósito de entregar el producto adquirido o servicio solicitado.<br />; Para administrar un concurso, promoción, estudio u otra acción del sitio</p>\r\n<p>La dirección de correo electrónico que usted proporcione para el procesamiento de pedidos, se puede utilizar para enviar información y las actualizaciones correspondientes a su pedido, además de recibir noticias de la compañía ocasional, actualizaciones de productos relacionados o servicio de información, etc</p>\r\n<p>Nota: Si en algún momento desea dejar de recibir futuros correos electrónicos, se incluyen instrucciones detalladas sobro como darse de baja en la parte inferior de cada correo electrónico.</p>\r\n<p><strong>¿Cómo protegemos su información?</strong></p>\r\n<p>Ponemos en práctica una serie de medidas de seguridad para mantener la seguridad de su información personal cuando usted ingresa, envía o accede a su información personal.<br />Ofrecemos el uso de un servidor seguro. Toda aquella información suministrada sensible / de crédito se transmite a través de Secure Socket Layer (SSL) y es ecriptada por nuestros proveedores de portal de Pago de modo tal que los datos sólo sean accesibles por las personas autorizadas con derechos especiales de acceso a dichos sistemas, los cuales están obligados a? mantener la información confidencial.<br />Después de una transacción, su información privada (tarjetas de crédito, números de seguridad social, finanzas, etc) no será almacenada en nuestros servidores.<br /><br /><strong>¿Cómo usamos los cookies?</strong></p>\r\n<p>Nosotros no utilizamos cookies.<br /><br /><strong>¿Compartimos cualquier información con terceros?</strong><br />Nosotros no vendemos, o proveemos a terceros sus datos personales. Esto no incluye los terceros de confianza que nos asisten en la operación de nuestro sitio web, la realización de nuestro negocio o servicio, siempre y cuando dichas partes se comprometan a mantener esta información confidencial. También podemos revelar su información si creemos que es apropiado para cumplir con la ley, hacer cumplir las políticas de nuestro sitio, o para proteger la nuestra o de otros derechos, propiedad o seguridad. Sin embargo, información identificable no personal, de visitantes, puede ser proporcionada a terceros para la comercialización, publicidad, u otros usos.<br /><br />Enlaces de terceros</p>\r\n<p>De vez en cuando, a nuestra discreción, podemos incluir u ofrecer productos o servicios de terceros en nuestro sitio web. Estos sitios de terceros tienen políticas de privacidad separadas e independientes. Por lo tanto, no tenemos responsabilidad alguna por los contenidos y actividades de estos sitios enlazados. Sin embargo, buscamos proteger la integridad de nuestro sitio y agradecemos cualquier comentario sobre estos sitios.<br /><br />Cumplimiento de Childrens Online Privacy Protection Act</p>\r\n<p>Estamos en el cumplimiento de los requisitos de COPPA (Children Online Privacy Protection Act), no recogemos ninguna información de personas menores de 13 años de edad. Nuestro sitio web, productos y servicios están dirigidos a las personas mayores de 13 años de edad.<br /><br />De suscripción de nuestras comunicaciones</p>\r\n<p>Si usted no desea mantener su suscripción a nuestros comunicados, para hacerlo simplemente vaya a la página http://www.c-e-s.com.ar/?p=unsubscribe complete el campo indicado con la dirección de e-mail que desea dar de baja, presione "continuar" y automáticamente será dado de baja de nuestra base de datos.<br /><br />Política de privacidad online</p>\r\n<p>Esta política de privacidad online se aplica únicamente a la información recogida a través de nuestra página web y no a la información recogida fuera de línea.<br /><br />Su consentimiento</p>\r\n<p>Al utilizar nuestro sitio, usted acepta nuestra política de privacidad.<br /><br />Cambios en nuestra Política de Privacidad</p>\r\n<p>Si decidimos cambiar nuestra política de privacidad, pondremos esos cambios en esta página.<br /><br />Envíenos un mensaje</p>\r\n<p>Si hay alguna pregunta sobre esta política de privacidad, puede contactarnos a las siguientes direcciones.<br />info@cordobaeshop.com.ar<br /><br />Llamenos al: 54 351 426-5978<br />Escribanos a: info@cordobaeshop.com.ar</p>\r\n<p>General Alvear 189<br />Cordoba, Cordoba CP 5000<br />Argentina<br /><br />Envienos un e-mail a :<br /><br />info@cordobaeshop.com.ar<br /> <br /><br />What information do we collect?</p>\r\n<p>We collect information from you when you register on our site, subscribe to our newsletter, respond to a survey or fill out a form.<br />When ordering or registering on our site, as appropriate, you may be asked to enter your: name or e-mail address. You may, however, visit our site anonymously.<br /><br />What do we use your information for?</p>\r\n<p>Any of the information we collect from you may be used in one of the following ways:<br />; To personalize your experience<br />(your information helps us to better respond to your individual needs)<br />; To improve our website<br />(we continually strive to improve our website offerings based on the information and feedback we receive from you)<br />; To improve customer service<br />(your information helps us to more effectively respond to your customer service requests and support needs)<br />; To process transactions<br />Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested.<br /><br />; To administer a contest, promotion, survey or other site feature<br /><br />; To send periodic emails<br />The email address you provide for order processing, may be used to send you information and updates pertaining to your order, in addition to receiving occasional company news, updates, related product or service information, etc.<br /><br />Note: If at any time you would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.<br /><br />How do we protect your information?</p>\r\n<p>We implement a variety of security measures to maintain the safety of your personal information when you enter, submit, or access your personal information.<br />We offer the use of a secure server. All supplied sensitive/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems, and are required to?keep the information confidential.<br />After a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.<br /><br />Do we use cookies?</p>\r\n<p>We do not use cookies.<br /><br />Do we disclose any information to outside parties?</p>\r\n<p>We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.<br /><br />Third party links</p>\r\n<p>Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.<br /><br />Childrens Online Privacy Protection Act Compliance</p>\r\n<p>We are in compliance with the requirements of COPPA (Childrens Online Privacy Protection Act), we do not collect any information from anyone under 13 years of age. Our website, products and services are all directed to people who are at least 13 years old or older.<br /><br />Online Privacy Policy Only</p>\r\n<p>This online privacy policy applies only to information collected through our website and not to information collected offline.<br /><br />Unsubscribe from our communications</p>\r\n<p>If you do not want to keep your subscription to our newsletters, you can go to http://www.c-e-s.com.ar/?p=unsubscribe, complete the field indicated with the e-mail that you wish to unsubscribe, then click "continue" and you will automatically be erase from our database.<br /><br />Your Consent</p>\r\n<p>By using our site, you consent to our privacy policy.<br /><br />Changes to our Privacy Policy</p>\r\n<p>If we decide to change our privacy policy, we will post those changes on this page.<br /><br />Contacting Us</p>\r\n<p><br />Call us at: 54 351 426-5978<br /><br />Write us a letter to:<br /><br />General Alvear 189<br /><br />Cordoba, Cordoba CP 5000<br />Argentina<br /><br />Send us a letter to any of the following adresses:<br /><br /><br />info@cordobaeshop.com.ar</p>\r\n</div>\r\n</div>', 'politicas-de-privacid'),
(4, 1, 1, 'Quiénes Somos', 'Averigüe más sobre nosotros', 'sobre nosotros, información', '<div class="cntArticleFlexibleHeader">\n<div class="cntArticleFlexibleHeader"><iframe style="border:0;" src="https://www.google.com/maps/embed?pb=!1m0!3m2!1sen!2sus!4v1440537886021!6m8!1m7!1sLjrq9Q8RNQkAAAQumx1CiQ!2m2!1d-31.41485600000002!2d-64.18066765889546!3f-120.10325!4f-2.82235!5f0.7820865974627469" width="100%" height="350" frameborder="0"></iframe>\n<h2>¿Quienes Somos?</h2>\n</div>\n<div class="cntHubContent">\n<div class="wraptxt">\n<p>CORDOBA E SHOP Es una empresa concebida por profesionales para satisfacer las nuevas necesidades tecnológicas del hombre, combinando tradicionales formas de comercialización y contacto con las más avanzadas del mundo.</p>\n<p>Está fundada sobre valores elementales para la consecución de cualquier proyecto: HONESTIDAD, TRANSPARENCIA, ESFUERZO, EFICIENCIA.</p>\n<p><strong>NUESTRA PROPUESTA</strong></p>\n<p>Ofrecer a nuestros clientes coorporativos una atención diferencial satisfaciendo todas sus necesidades a precios promocionales. Crear y mantener un vínculo entre las distintas instituciones y nuestra empresa, apuntando al mutuo beneficio en el largo plazo.</p>\n<p><strong>MISION</strong></p>\n<p>Satisfacer las necesidades de nuestros clientes en materia de artículos tecnológicos, ofreciéndoles siempre productos con la mejor relación precio - prestación - financiación. Llegar a todos los argentinos a traves de las formas más modernas de comercialización, y así superar las expectativas de los clientes, con la tranquilidad que les brinda nuestra Garantía y su Confianza.</p>\n<p> </p>\n<iframe src="https://www.youtube.com/embed/lPrZY5yIkZU" width="560" height="315" frameborder="0"></iframe></div>\n</div>\n</div>', 'quienes-somos'),
